import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="appWrapper">
        <div className="header">Header</div>
        <div className="navbar">Navbar</div>
        <div className="content">Profile Dialogs Users</div>
    </div>
  );
}

export default App;
